import React from 'react';
import {Form, Input} from 'semantic-ui-react';
const Login = () => {
	return(
		<div>
			<h3>Login</h3>
			<Form>
				<Form.Group widths='equal'>
					<Form.Field
                        id="email"
                        control={Input}
                        label = ""
					/>
				</Form.Group>
			</Form>
		</div> 
	);
};

export default Login;
